  title = 'mdf';

  contactForm = new FormGroup({
    username: new FormControl(),
    password: new FormControl(),
  });

  onSubmit() {
    console.log(this.contactForm.value);
  }
}
<h1>Admin</h1>
<h3>Get All Bill Reports</h3>
<form>
  <input name="userName" type="text" placeholder="Enter admin username" />
  <input name="password" type="password" placeholder="Enter admin password" />
  <button type="submit">Get Bills!</button>
</form>
<form
  [formGroup]="userForm"
  (ngSubmit)="onSubmit()"
  action="admin-dashboard/getAllBillsResult"
  method="get"
>
  <input
    type="text"
    id="username"
    name="userName"
    formControlName="username"
    placeholder="Enter username"
  />
  <input
    type="password"
    id="password"
    name="password"
    formControlName="password"
    placeholder="Enter password"
  />
  <button type="submit">Submit</button>
</form>
